import Link from "next/link";

const Navbar = () => (
  <div>
    <ul>
      <li>
        <Link>
          <a href="/">Home</a>
        </Link>
        <Link>
          <a href="/about">About</a>
        </Link>
      </li>
    </ul>
  </div>
);

export default Navbar;
